import React, { useState } from 'react'

const ClickyButton = (props) => {
    const { buttonClicksState, setButtonClicksState } = useState(0)

    return (
        <button onClick={() => setButtonClicksState(buttonClicksState+1)}>
        click me
        </button>
    )
}

export default ClickyButton
